import React from 'react';
import { Accordion } from '../components';
import accordsignin from '../components/accordsignin';
import faqsData from '../fixtures/faqs.json';

export function FaqsContainer() {
    return(
        <Accordion>
            <Accordion.Title>Frequently Asked Question</Accordion.Title>
            {faqsData.map (item =>
              <Accordion.Item key={item.id}>
                <Accordion.Header>{item.header}</Accordion.Header>
                <Accordion.Body>{item.body}</Accordion.Body>
              </Accordion.Item>  
            )}
            <Accordion.Item />
              <accordsignin>
                  <accordsignin.Button>Try it Now</accordsignin.Button>
                  
              </accordsignin>

              <accordsignin.Text>Ready to watch? 
                  Before that u need to Register an account please click on the Signup button now to Signup</accordsignin.Text>

        </Accordion>

        
    );
}
